import actionConstants from "./actionsConstants";

const initialState = {
  todo: [],
};

function reducers(state = initialState, action) {
  const { type, inputData } = action;
  switch (type) {
    case actionConstants.GET_TODO_REQUEST:
      console.log(inputData);
      return {
        ...state,
        inputData,
      };
    default:
      return state;
  }
}

export default reducers;
